		var production_speed = 0.1;
		var isReady = false;
		var isManager = false;
		var level = 1;
		
		var farm = this;
		var barn = exportRoot.barn;
		var clickArea = this.click_area;
		var currEggsNum = exportRoot.farm_bubble_anim.bubble.curr;
